import React from 'react'
import '../css/pure-css-progress-bars-master/assets/css/cssprogress.css'

export default class ChampionStatBars extends React.Component {


  render() {
    return(
<div>
      <p>ATTACK: {attack}</p>


      <p>DEFENSE: {defense}</p>
      <p>MAGIC: {magic}</p>
      <p>DIFFICULTY: {difficulty}</p>

      <div class="cssProgress">
      <div class="progress2">
        <div class="cssProgress-bar cssProgress-danger" data-percent={attack * 10} style={{transition: 'none 0s ease 0s', width: `${attack * 10}%`}}> <span class="cssProgress-label">{attack}</span></div>
      </div>
    </div>
</div>
    )
  }
}
